import c from './Dialogs.module.css';
import React from 'react';
import { NavLink } from 'react-router-dom';

const DialogItems = (props) => {
    let path = "/dialogs/" + props.id;
    return (
        <div className={c.User}>
            <img src="https://image.flaticon.com/icons/png/512/108/108186.png" className={c.Avatar} />
            <span><NavLink to={path} activeClassName={c.Active}>{props.name}</NavLink></span><hr />
        </div>
    )
}

const Message = (props) => {
    return(
        <div className={c.Dialog}>{props.message}</div> 
    )
}

const Dialogs = (props) => {

    let dialogsData = [
        {id:1, name: "Pavel"},
        {id:1, name: "Petr"},
        {id:1, name: "Dima"},
        {id:1, name: "Anton"},
    ]

    return (
        <div className={c.Dialogs}>
            <div className={c.Users}>
                <DialogItems name={dialogsData[0].name} id={dialogsData[0].id}/>
                <DialogItems name={dialogsData[1].name} id={dialogsData[1].id}/>
                <DialogItems name={dialogsData[2].name} id={dialogsData[2].id}/>
                <DialogItems name={dialogsData[3].name} id={dialogsData[3].id}/>               
            </div>
            <div className={c.Line}></div>
            <div className={c.Messages}>
                <Message message="Hello"/>
                <Message message="Hi"/>
                <Message message="How are you?"/>
                <Message message="Bye"/>
            </div>
        </div>
    )
}

export default Dialogs;
